  beforeEach(async () => {
    await TestBed.configureTestingModule({
      imports: [CarInfoComponent]
    })
    .compileComponents();

    fixture = TestBed.createComponent(CarInfoComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

